body {
  background: #00a3ee;
  font-synthesis: none;
  text-rendering: optimizeLegibility;
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
  -webkit-tap-highlight-color: transparent;
  background-image: url(../images/Imagemin_bg.jpg);
  background-size: cover;
}
.overflow_a {
  overflow: auto;
}
#app {
  position: relative;
  max-width: 10rem;
  height: 100%;
  margin: 0 auto;
  background: #ebf1f6;
  padding-bottom: constant(safe-area-inset-bottom); // 兼容 IOS<11.2
  padding-bottom: env(safe-area-inset-bottom); // 兼容 IOS>11.2
}
.van-number-keyboard {
  max-width: 10rem;
}
.jz_f {
  left: 50% !important;
  transform: translateX(-50%);
}
.kgdialog {
  .van-dialog__header {
    padding-top: 0.4rem;
  }
  .van-dialog__content {
    max-height: 9.33333rem;
    overflow: auto;
    .dialog-content {
      text-align: left;
    }
    p {
      margin-bottom: 0.13333rem;
    }
  }
  .button-wrapper {
    background: #fff;
  }

  .radio-checked {
    $scale: calc(18 / 35 * 1.9);
    $spriteHome: "@/assets/images/sprites-home.png";
    $sprite-computed-factor: 0.7;
    background: url($spriteHome) calc(-0px * $sprite-computed-factor * $scale)
      calc(-282px * $sprite-computed-factor * $scale) no-repeat;
    width: 0.46667rem;
    height: 0.46667rem;
    background-size: calc(108px * (7 / 10) * $scale) calc(730px * (7 / 10) * $scale);
  }
  .radio-uncheck {
    width: 0.386667rem;
    height: 0.386667rem;
    border: 1px solid #868d9a;
    border-radius: 50%;
  }
}
.content_center {
  p {
    text-align: center;
  }
}
.confirm-dialog {
  .van-dialog__footer {
    display: none;
  }
}
.selldialog {
  .dialog-title {
    height: 50px;
  }
  .dialog-content {
    text-align: center;
    img {
      width: 120px;
    }
  }
  // .van-button--block {
  //   height: 80px !important;
  // }
}

.dropdown_f {
  border-bottom: rgba($color: #d6dce8, $alpha: 0.8) 1px solid;
  .van-dropdown-menu__bar {
    z-index: 1;
    height: 1.06rem !important;
    // height: 80px !important;
  }
  .van-dropdown-menu__title {
    position: static;
    display: block;
    width: 100%;
    p {
      line-height: 30px;
    }
    .van-ellipsis {
      display: flex;
      align-items: center;
      .switchover {
        width: 100%;
        height: 60px;
        line-height: 60px;
        position: absolute;
        bottom: -60px;
        text-align: center;
        left: 0;
      }
    }
    .van-image {
      width: 48.5px;
      height: 48.6px;
    }
    &:after {
      background: url("../images/common/success.png");
      width: 30px;
      height: 30px;
      background-size: cover;
      border: none;
      transform: rotate(0);
      opacity: 1;
      margin-top: -13px;
      margin-right: 24.5px;
    }
  }
}
.dropdown_item_f {
  cursor: pointer;
  // width: 670px;
  width: 9rem;
  border-top: rgba($color: #d6dce8, $alpha: 0.8) 1px solid;
  &.quick-coin {
    // max-height: 200px;
    .van-dropdown-item__content {
      max-height: unset;
    }
  }
  .drop_f_item {
    padding-left: 16px;
    // height: 80px;
    height: 1.06rem;
    border-bottom: rgba($color: #d6dce8, $alpha: 0.8) 1px solid;
    p {
      line-height: 30px;
    }
    .van-image {
      width: 48.5px;
      height: 48.6px;
    }
    .rightimg {
      width: 30px;
      height: 30px;
      position: absolute;
      right: 0;
    }
  }
  .switchover_s {
    height: 60px;
    line-height: 60px;
    text-align: center;
  }
  .van-dropdown-item__content {
    // max-height: 285px;
    border-radius: 11px;
  }
}
.red_f {
  color: #ff363d !important;
}
.wideMode {
  .global-dialog-container {
    .van-dialog {
      transform: scale(0.8);
    }
  }
  .van-toast {
    transform: scale(0.6);
    transform-origin: 50% -50%;
    // margin-top: -5% !important;
  }
  .van-dialog {
    max-height: 100% * 1.6;
    transform: scale(0.6);
    transform-origin: 50% -50%;
    // margin-top: -5% !important;
  }
  .select_dialog {
    max-height: 100% * 1.6;
    transform: scale(0.85);
    transform-origin: 50% -50%;
    margin-top: -8% !important;
  }
  .van-badge--dot {
    width: 10px;
    height: 10px;
    top: 10px;
  }
}
#qr-canvas-visible {
  display: none !important;
}
.heng {
  width: 100%;
  height: 15px;
